INSERT INTO `noticias` (`id`, `titulo`, `descricao`, `desshort`, `categoria`, `imagem`, `autor`, `data`, `s_noticia`, `s_index`, `views`, `Confirmed`) VALUES
(26, 'Miró de Serralves', '<p></br><span class="_5yl5"><span>Dia 13 de Janeiro 2017, as turmas\r\nde artes do 12 ano, no âmbito\r\nda disciplina de Desenho A, realizaram uma visita de estudo ao\r\nPorto, na qual visitaram o Museu Soares dos Reis e o Museu de\r\nPorto.</span></span></p><p><span class="_5yl5"><span>\r\nOs milhares de visitantes presentes no local tornaram difícil a visita, nomeadamente no que se\r\nrefere a observar as peças ali patentes do conceituado artista espanhol.</span></span></p><p><span class="_5yl5"><span>\r\nO tipo de exposição e o número de visitantes contrastou enormemente com a visita ao\r\noutro museu, o Soares dos Reis, que decorreu com\r\nnormalidade e tränquilidade\r\nJOSÉ VIEIRA</span></span><br></p>', 'Dia 13 de Janeiro 2017, as turmas de artes do', 'Esab', 'assets/img/screenshot-issuu.com-2017-06-30-16-05-48.png', 'Alex', '2017-06-30', 0, 0, 3, 'Yes'),
(14, 'Magusto na nossa escola', '<p></br>No dia 11 de novembro, comemorou-se na nossa escola com muita alegria, o dia de S. Martinho. Na aula de Expressão Dramática, fize- ram-se cartuchos com folhas de jornal carimbados com formas de castanhas e um cartaz com provérbios alusivos aoDia Logo de manhã, cortaram-se as castanhas. que aguardavam a hora certa de serem colocadas no assador. Entretanto, colocou-se o cartaz no átrio da Escola e embelezou-se o espaço envolvente com ouriços das castanhas, cestos com os cartuchos preparados para as castanhas quentinhas, folhas e ramos secos de árvores e sobretudo, como entusiasmo de todos. Fez-se a fogueira com caruma e carvão e, a já tudo pronto, colocaram-se as castanhas, sal e o cheirinho começou a pairar no ar e as castanhas começaram a estalar! Foi com grande satisfação que se fez uma roda à volta do assador e se degustaram as primeiras castanhas quentinhas. &nbsp;<br></p>', 'No dia 11 de novembro, comemorou-se o dia de ', 'Esab', 'assets/img/magusto.PNG', 'manito', '2016-12-14', 1, 0, 0, 'Yes'),
(13, 'Robótica: equipas da Brotero em 2º e 4º lugar', '<p></br>O concurso de robótica BotOlympics, organizado pelo Clube de Robótica da Universidade de Coimbra, decorreu nos dias 17, 18, 19 e 22 de Fevereiro de 2017, no Departamento de Engenharia Electrotécnica e de Computadores da Faculdade de Ciências e Tecnologia da Universidade de Coimbra. A Brotero, através do Clube PRODE, participou com duas equipas no torneio para alunos do ensino secundário, entre um conjunto de equipas de outras escolas de Coimbra, Condeixa-a-Nova e Figueira da Foz. </br></br> A equipa PRODE A, constituída pelos alunos do 12º ano, João Pedro da Fonseca Santiago, Leandro Gabriel Marques Correia, Mariana Alexandra Sanches Ferreira e Nuno André da Silva Marques, obteve o 2º lugar. A equipa PRODE One, constituída pelos alunos do 12º ano, Carolina Inês Marques, José Pedro Tomás Lopes, Pedro Vicente Monteiro Serrano, e pelo aluno do 10º ano, Samuel dos Santos Carinhas, estabeleceu-se em 4º lugar. O 1º lugar foi alcançado por uma equipa da Escola Secundária José Falcão e o 3º lugar por uma equipa do Agrupamento de Escolas de Condeixa-a-Nova. </br></br> Todos os alunos da Brotero estão de parabéns, não só pelos resultados alcançados, mas principalmente pelo empenho demonstrado, pelo espírito de grupo e até pela generosidade demonstrada ao apoiar outras equipas.<br></p>', 'A Brotero, através do Clube PRODE, participou', 'Esab', 'assets/img/Capturar444.PNG', 'manito', '2017-01-10', 1, 0, 2, 'Yes'),
(25, 'Eficiência energética', '<p></br><span class="_5yl5"><span>O grupo de eletrotecnia levou a efeito, no passado dia 2 de março,\r\nno auditórlo da nossa Escola, em\r\nparceria com a Schnelder Elétric\r\nPortugal, uma Palestra sobre o\r\ntema "A eficlência Energética: as necessidades\r\nde energia, o conforto os Sistemas de Monitorização e Gestão de Entrega e os Regulamentos".</span></span><br></p>', 'O grupo de eletrotecnia levou a efeito, no pa', 'Esab', 'assets/img/screenshot-issuu.com-2017-06-30-15-59-44.png', 'Alex', '2017-06-30', 0, 0, 1, 'Yes'),
(27, 'Heróis do séc. XXI na Coimbra BD', '<p><span class="_5yl5"><span><br></span></span></p><p><span class="_5yl5"><span>A convite da Associação Videolob\r\nfoi opresentada na Casa da Cul\r\ndo\r\nda Coimbra BD, uma exposição de\r\nfotografia de alunos de Oficina Multimédia do 12º ano.\r\n</span></span></p><p><span class="_5yl5"><span>No âmbito da disciplina de Oficina Mutimédia do 12 ano do Curso de Artes Visuais, é proposta anualmente, a produção de fotografias manipuladas digitalmente. No corrente ano, foi lançado\r\na duas turmas da referida disciplina o desafio de\r\nprodução de fotografias tomando como ponto de partida\r\no mote: Imagina-te como um herói do séc.XXI".</span></span></p><p><span class="_5yl5"><span>A seleção apresentada na Coimbra BD procurou mostrar a riqueza criativa e o empenho manifestados pelos alunos na execução dos trabalhos, assim como uma\r\nvariedade de registos possíveis,\r\nfruto do imaginário dos jovens dos nossos dias.</span></span><br></p>', 'A convite da Associação Videolob foi opresent', 'Esab', 'assets/img/screenshot-issuu.com-2017-06-30-16-20-35.png', 'Alex', '2017-06-30', 0, 1, 2, 'Yes'),
(24, 'Road Show', '<p></br><span class="_5yl5"><span>Durante a manhã do passado dia 1 de fevereiro, uma equipa da Revista Forum Estudante +BP&nbsp; SEGURANÇA AO SEGUNDO realizou uma ação de comunicação na escola secundaria de Avelar Brotero.</span></span></p><p><span class="_5yl5"><span> A referida ação inseriu-se no Roadshow BP SEGURANÇA AO MINUTO, um\r\ndesafio que visa promover a prevenção e a segurança rodoviárias junto\r\ndos estudantes do ensino secundário. Desenvolvido\r\ncom o apoio\r\nSegurança Rodoviária e da Diregão-Geral de Educação, este programa tem como objetivo inverter os\r\ndados da sinistralidade rodoviária entre os jovens\r\nportugueses, cujo risco de morte, entre os 18 e os 24\r\nanos, é cerca de 30% superior ao da restate população.</span></span></p><p><span class="_5yl5"><span>\r\nNo auditório da escola, os alunos presentes assistiram a uma sessão de sensibilização sobre\r\na temática da prevenção e da segurança rodoviárias, que contou com as participações de representantes da equipa do Desafio BP Segurança ao\r\nSegundo e da Associação Salvador.O piloto Miguel\r\nBarbosa, que apadrinha esta inciativa, realizou\r\numa das comunicações. Outro dos comunicadores, Cristiano Magalhães, da Associação Salvador\r\ncolaborou com a sua presença e o seu exemplo na\r\nsensibilização para uma condução responsável.</span></span><br></p>', 'Durante a manhã do passado dia 1 de fevereiro', 'Esab', 'assets/img/screenshot-issuu.com-2017-06-30-15-33-15.png', 'Alex', '2017-06-30', 1, 1, 2, 'Yes');
INSERT INTO `noticias` (`id`, `titulo`, `descricao`, `desshort`, `categoria`, `imagem`, `autor`, `data`, `s_noticia`, `s_index`, `views`, `Confirmed`) VALUES
(28, 'Um livro partilhado', '<p><span class="_5yl5"><span><br></span></span></p><p><span class="_5yl5"><span>No dia 23 de fevereiro, nós, alnos da turma do 11.º1D, tivemos uma aula de Portugues diferente do habitual.<br></span></span></p><p><span class="_5yl5"><span>No espaço da biblioleca da Escola quatro\r\ndos nossos colegas apesertaram a obra Amor\r\nde Perdição de Camilo Castelo Branco, à turma do\r\n10.1C. Este espaço estavam preparados para nos receber, pois no canto das exposições, recriou-se o\r\nambiente da prisão de Camilo e expuseram-se livros e objetos que estavam com ele relacionados.</span></span></p><p><span class="_5yl5"><span>\r\nA Inês, o António, o Abdellahi e a Mariana\r\nforam apresentando o essencial da obra de uma\r\nforma interativa e original teminando com a música de Mariza, O melhor de mim, que foi associada\r\nao herói romântico que é Simão Botelho .Enquanto\r\nos nossos colegas estavam em cena, a turma estava nas filas detrás a apoiar e incentivar, pois eles\r\nestavam muito nervosos. E como nós os ajudámos\r\na organizar e memorizar as ideias, também sentimos esse nervoso miudinho, pois demos conta\r\nde algumas falhas que foram acontecendo. Mas\r\na professora não deu importância ao caso e disse "correu muito bem!" e ouvir isto foi um alivio.</span></span></p><p><span class="_5yl5"><span>Esta experiéncia de uma obra partihada\r\npara um auditório desconhecido, revelou-se muito\r\nerriquecedora tanto para nós que assistimos como para aqueles que apresentaram. Sentimo-nos mais unidos e isso fortaleceu os laços entre todos.</span></span></p><p><span class="_5yl5"><span><br></span></span></p><p align="center"><img style="width: 607px;" src="data:image/png;base64," data-filename="screenshot-issuu.com-2017-06-30-16-34-27.png"><span class="_5yl5"><span><br></span></span></p><p><span class="_5yl5"><span><br></span></span><br></p>', 'No dia 23 de fevereiro, nós, alnos da turma d', 'Esab', 'assets/img/screenshot-issuu.com-2017-06-30-16-34-04.png', 'Alex', '2017-06-30', 0, 0, 1, 'Yes');
INSERT INTO `noticias` (`id`, `titulo`, `descricao`, `desshort`, `categoria`, `imagem`, `autor`, `data`, `s_noticia`, `s_index`, `views`, `Confirmed`) VALUES
(32, 'Mostra Verdes Anos', '<p><br></p><p><span class="_5yl5"><span>Dia 11 de maio, teve lugar no Mosteiro de\r\nSanta Clara-a-Velha a mostra "Verdes\r\nAnos" promovida no âmbito do Plano Nacional de Cinema e organizada numa \r\nparceria entre a DRCC - Direção Regional da Cultura-, a Fila K - \r\nAssociação\r\nCultural de promoção do Cinema\r\n-, o Agrupamento de Escolas Coimbra Oeste e a\r\nEscola Secundárla Avelar Brotero (ESAB).\r\n</span></span></p><p><span class="_5yl5"><span>Na sessão, foram apresentados 13 videos\r\nrealizados por alunos da Oficina Multimédia do 12º\r\nAno da ESAB.\r\n</span></span></p><p><span class="_5yl5"><span>Estiveram presentes 43 \r\nalunos da Secundárla D. Duarte e da Avelar Brotero que, no final da \r\nsessão votaram no melhor filme: na modalidade Animação, o filme "Snail",\r\n da aluna Andreia\r\nPimentel (12 2B), foi o mais votado. Na modalidade\r\nFicção e Documental o filme "TheDream" , de Carolina Bogalho Joana \r\nRovira e Mariana Ångelo (12 2A), foi o que obteve maior número de votos.</span></span></p><p><br></p><p align="center"><img style="width: 463px;" src="data:image/png;base64," data-filename="screenshot-issuu.com-2017-07-01-19-43-41.png"><br></p>', 'Dia 11 de maio, teve lugar no Mosteiro ', 'Esab', 'assets/img/screenshot-issuu.com-2017-07-01-19-42-35.png', 'Alex', '2017-07-01', 0, 1, 2, 'Yes');
INSERT INTO `noticias` (`id`, `titulo`, `descricao`, `desshort`, `categoria`, `imagem`, `autor`, `data`, `s_noticia`, `s_index`, `views`, `Confirmed`) VALUES
(34, 'Exposição de desenho', '<p><br></p><p>Os alunos do cursode Artes Visuais, do 11º ano, turmas A e B, têm vindo a expor, desde o inicio di mes de maio, trabalhos desenvolvidos durante o ano letivo na disciplina de Desenho - A.</p><p>A diversidade plastica apresentada reflete quer as diferentes unidades tematicas e conteudos programaticos desenvolvidos, quer a natural individualidade de representação, progressiva, adquirida pelos alunos ao longo do percurso escolar.</p><p><br></p><p align="center"><img style="width: 469.5px; height: 345.441px;" src="data:image/png;base64," data-filename="screenshot-issuu.com-2017-07-03-09-59-08.png"></p><p align="center"><br></p><p align="center"><img style="width: 441px;" src="data:image/png;base64," data-filename="screenshot-issuu.com-2017-07-03-09-58-01333.png"></p><p align="center"><br></p><p align="center"><img style="width: 419px;" src="data:image/png;base64," data-filename="screenshot-issuu.com-2017-07-03-09-58-01.png"></p><p align="center"><br></p><p align="center"><br></p><p align="center"><br></p><p align="center"></p>', 'Os alunos do cursode Artes Visuais, do 11º an', 'Esab', 'assets/img/screenshot-issuu.com-2017-07-03-09-59-29.png', 'Alex', '2017-07-03', 0, 0, 3, 'Yes');

